pragma solidity 0.6.7;
pragma experimental ABIEncoderV2;

contract Prontuario {
    struct data {
        string name;
        string cpf;
        string rg;
        string nome_social;
        string dt_nasc;
        string sexo;
        string cor_raca;
        string nacionalidade;
        string telefone;
        string email;
        string orientacao_sexual;
        string identidade_de_genero;
        string nome_da_mae;
        string nome_do_pai;
        string estado_civil;
        string NIS_PIS_PASEP;
        string ocupacao;
        string escolaridade;
        string tipo_sanguineo;
        string pais;
        string municipio;                
        string estado;
        string bairro;
        string logradouro;
        string numero;
        string cep;
        string complemento;
        string referencia;
        string area;
        string microarea;
        string n_prontuario;         
    }
}
